import React, { Component,useState } from 'react'

const Cellphone=()=>{
    const[phone,Setphone]=useState([
        {title:'hello',text:'behnam'},
        {title:'hello',text:'behnam'},
        {title:'hello',text:'behnam'},
        {title:'hello',text:'behnam'},
    ])
    const showCellphone=()=>phone.map((phone)=>{
        <div>
<h1>{phone.title}</h1>,
<h1>{phone.text}</h1>,
        </div>
    
    })
    return(
        <div style={{height:500,backgroundColor:'yellow',width:'100%'}}>
     {showCellphone}
        </div>
    )
}
export default Cellphone;
